import React, {Component} from 'react';
import {Bar,Line,Pie} from 'react-chartjs-2';

class Chart extends Component {
  constructor(props) {
    super(props);
    this.state = {
      chartData: {
        labels: ['test1', 'test2', 'test3', 'test4', 'test5'],
        datasets: [
          {
            label:'Population',
            data: [1,2,3,4,5],
            backgroundColor: [
              'rgba(200, 200, 200, .6)',
              'rgba(100, 200, 200, .6)',
              'rgba(200, 100, 200, .6)',
              'rgba(200, 200, 100, .6)',
              'rgba(200, 0, 200, .6)'
            ]
          }
        ]
      }
    }
  }

  componentDidMount() {
    const proxyurl = "https://cors-anywhere.herokuapp.com/";
    const url = "https://69smoo2dc6.execute-api.us-east-1.amazonaws.com/api/ics";
    fetch(proxyurl + url)
      .then(res => res.json())
      .then(json => {
        this.setState({
          isLoaded: true,
          items: json,
        })
      });
  }

  render() {
    return (
      <div classname="chart">
      <Bar
        data={this.state.chartData}
        options={{
        }}
      />
      </div>
    )
  }
}

export default Chart;
